収容力たっぷりのカバン型ペンケース！底ポケットに分けて機能的に収容できる！<img src="http://image.rakuten.co.jp/cocodecow/cabinet/zaikocall.gif" width="303" height="100" border="0"><br />取り出し口に芯材が入っているため、大きく開いた状態をキープすることができ、ペントレー感覚で中身をラクに探すことができます。底ポケットは、ハサミや定規など平たくて大きいものや、付箋などペンケース内で汚れやすいものを分けて収納することができます。バッグの形で持ち手がついているので、持ち運びに便利です。ペンケースとしてだけでなく、化粧ポーチや小物入れなど、さまざまな使い方が楽しめます。<BR>●色：ゴールド（本体／ゴールドのドット柄、持ち手・底／黒）●サイズ：幅２００×奥行７０×高さ１１０ｍｍ（持ち手は含まず）●材質：ポリエステル<BR><BR><BR><BR><BR>こくよ　ＫＯＫＵＹＯ　ぺんけーす　机上整理用品　ペンポーチ　ふでばこ　筆箱　筆入れ　ＧＯＬＤ　金　キン　きん　ＦＶＢＦ１５０４　小学校文具ペンケース　小学生文房具　学童用品　学用品　子供用　子ども用　ドット柄　小物入れ　水玉模様　デスク回り用品　デスクトップ収納　ペンたて　ボールペンたて　ぺんたて　ペン入れ　ボールペン立て　ペンシルホルダー　ペンタテ　ペン置き　ペンいれ<style type="text/css">
